epos/dotnet/orleans/milestones/53', 'html_url': 'https://github.com/dotnet/orleans/milestone/53', 'labels_url': 'https://api.github.com/repos/dotnet/orleans/milestones/53/labels', 'id': 6860191, 'node_id': 'MDk6TWlsZXN0b25lNjg2MDE5MQ==', 'number': 53, 'title': 'Documentation', 'description': None, 'creator': {'login': 'ReubenBond', 'id': 203839, 'node_id': 'MDQ6VXNlcjIwMzgzOQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/203839?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ReubenBond', 'html_url': 'https://github.com/ReubenBond', 'followers_url': 'https://api.github.com/users/ReubenBond/followers', 'following_url': 'https://api.github.com/users/ReubenBond/following{/other_user}', 'gists_url': 'https://api.github.com/users/ReubenBond/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ReubenBond/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ReubenBond/subscriptions', 'organizations_url': 'https://api.github.com/users/ReubenBond/orgs', 'repos_url': 'https://api.github.com/users/ReubenBond/repos', 'events_url': 'https://api.github.com/users/ReubenBond/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ReubenBond/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 20, 'closed_issues': 31, 'state': 'open', 'created_at': '2021-06-16T15:22:18Z', 'updated_at': '2022-03-25T16:19:32Z', 'due_on': None, 'closed_at': None}, 'comments': 20, 'created_at': '2021-11-15T14:41:33Z', 'updated_at': '2022-04-22T13:57:03Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'The original issue is closed, therefore I cannot update it: https://github.com/dotnet/orleans/issues/7098

But I have some news, because a customer of mine found out how to run Orleans in Azure App Services.

What you have to do:

* Create a VNet + Subnet in Azure and connect it to your app service plan
* Create a Network Security Group and connect it to the subnet
* Run `az webapp config set -g {ressource_group_name} -n {app_service_name} --generic-configurations '{"vnetPrivatePortsCount": 1}` (this is the secret ingredient, that create 2 virtual ports and expose the added ports to WEBSITE_PRIVATE_PORTS environment variable.

You have to use the following enviornment variables then:

* WEBSITE_PRIVATE_PORTS
* WEBSITE_PRIVATE_IP

```
public static async Task<ISiloHost> StartSilo()
{
	IPAddress endpointAddress = IPAddress.Parse(Environment.GetEnvironmentVariable("WEBSITE_PRIVATE_IP"));
	var strPorts = Environment.GetEnvironmentVariable("WEBSITE_PRIVATE_PORTS").Split(',');
	if (strPorts.Length < 2)
	{
	  throw new Exception("Insufficient private ports configured.");
	}
	int siloPort = int.Parse(strPorts[0]);
	int gatewayPort = int.Parse(strPorts[1]);
	// define the cluster configuration
	var builder = new SiloHostBuilder()
	  //.UseLocalhostClustering()
	  .Configure<ClusterOptions>(options =>
	  {
		options.ClusterId = "dev";
		options.ServiceId = "OrleansBasics";
	  }​​​​​​​​​​​​​​​​​​​​​​​​​​​​​​)
	  .UseAzureStorageClustering(options => options.ConnectionString = "...")
	  .Configure<EndpointOptions>(options =>
	  {
		options.AdvertisedIPAddress = endpointAddress;
		options.SiloPort = siloPort;
		options.GatewayPort = gatewayPort;
		options.SiloListeningEndpoint = new IPEndPoint(IPAddress.Any, siloPort);
		options.GatewayListeningEndpoint = new IPEndPoint(IPAddress.Any, gatewayPort);
	  }​​​​​​​​​​​​​​​​​​​​​​​​​​​​​​)
	  // Application parts: just reference one of the grain implementations that we use
	  .ConfigureApplicationParts(parts => parts.AddApplicationPart(typeof(HelloGrain).Assembly).WithReferences())
	  .ConfigureLogging(logging => logging.AddConsole());
	var host = builder.Build();
	await host.StartAsync();
	return host;
}
```

I have not tested it myself yet, but It works with my CMS: https://github.com/squidex/squidex and I hope we can provide docs for Squidex soon, with some screenshots.', 'reactions': {'url': 'https://api.github.com/repos/dotnet/orleans/issues/7391/reactions', 'total_count': 6, '+1': 4, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 1, 'eyes': 1}, 'timeline_url': 'https://api.github.com/repos/dotnet/orleans/issues/7391/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/dotnet/orleans/issues/comments/1106543350', 'html_url': 'https://github.com/dotnet/orleans/issues/7391#issuecomment-1106543350', 'issue_url': 'https://api.github.com/repos/dotnet/orleans/issues/7391', 'id': 1106543350, 'node_id': 'IC_kwDOAa7L185B9IL2', 'user': {'login': 'bradygaster', 'id': 41929050, 'node_id': 'MDQ6VXNlcjQxOTI5MDUw', 'avatar_url': 'https://avatars.githubusercontent.com/u/41929050?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/bradygaster', 'html_url': 'https://github.com/bradygaster', 'followers_url': 'https://api.github.com/users/bradygaster/followers', 'following_url': 'https://api.github.com/users/bradygaster/following{/other_user}', 'gists_url': 'https://api.github.com/users/bradygaster/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/bradygaster/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/bradygaster/subscriptions', 'organizations_url': 'https://api.github.com/users/bradygaster/orgs', 'repos_url': 'https://api.github.com/users/bradygaster/repos', 'events_url': 'https://api.github.com/users/bradygaster/events{/privacy}', 'received_events_url': 'https://api.github.com/users/bradygaster/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-22T13:57:03Z', 'updated_at': '2022-04-22T13:57:03Z', 'author_association': 'MEMBER', 'body': '> > https://github.com/bradygaster/OrleansOnAzureAppService
> 
> One of the primary benefits of Orleans is location transparency and elastic scaling. It would be really nice to showcase that with this example. I wonder how hard it would be to parameterize the bicep templates to add 1..n silos? Thoughts, @bradygaster ?

Definitely like the idea. Let me see if I can up the ante, though, on another sample app I have running in App Service with an Orleans back-end. https://wanderland.cloud, the app we used for a few internal scenarios, was something we put together to show a never-ending Orleans silo running a lot of grains. Each "wanderer" - the players running around the board - are individual `WandererGrain` instances that literally wander around randomly. 

I'd like to extend this so that you could do something like (this is incomplete, just an idea, open for suggestions):

`
[NamedWanderer("bradyg")]
public class BradyWanderer : IWandererGrain
{
}
`

And then, in my `Wander` method - the one that runs to make a player move - could have my own implementation in it. With that, folks could submit a pull request, write their own logic for avoiding the monster and staying alive longer, and append the deployment to run on their own App Service instance. Then, when we do a deployment, the random wanderers would run as before, but when a user logs in to the system, their wanderer implementation would run. At that point, if folks wanted to, they could also augment the bicep template to create their "own" app service, and place their player grain on it. That way the game grains could run in the main silo and the player grains in their independent silos. 

It's contrived as heck, I know, but, I wanted to propose it as something the community could build and play together. ', 'reactions': {'url': 'https://api.github.com/repos/dotnet/orleans/issues/comments/1106543350/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

