 None, 'body': "## Background and Motivation

We are using the factory method overload `public static IServiceCollection AddHostedService<THostedService>(this IServiceCollection services, Func<IServiceProvider, THostedService> implementationFactory) where THostedService : class, IHostedService` to add multiple hosted services, but each with different configuration. Every hosted service is responsible for listening to a certain service bus topic. This didn't work and only the first hosted service was started. After diving into the code, we noticed that `public static void TryAddEnumerable(this IServiceCollection services, ServiceDescriptor descriptor)` is called and that method only adds if there is not already a Type / Implementation combination present.

It would be great if this behavior can be made more clear by renaming AddHostedService to for instance TryAddHostedService, or by being able to configure the way AddHostedService should behave.

## Proposed API

```diff
namespace Microsoft.Extensions.DependencyInjection
{
    public static class ServiceCollectionHostedServiceExtensions
    {
        public static IServiceCollection AddHostedService<THostedService>(this IServiceCollection services)
            where THostedService : class, IHostedService
        {
-           services.TryAddEnumerable(ServiceDescriptor.Singleton<IHostedService, THostedService>());
+           services.Add(ServiceDescriptor.Singleton<IHostedService, THostedService>());

            return services;
        }

        public static IServiceCollection AddHostedService<THostedService>(this IServiceCollection services, Func<IServiceProvider, THostedService> implementationFactory)
            where THostedService : class, IHostedService
        {
-           services.TryAddEnumerable(ServiceDescriptor.Singleton<IHostedService>(implementationFactory));
+           services.Add(ServiceDescriptor.Singleton<IHostedService>(implementationFactory));

            return services;
        }
+
+       public static IServiceCollection TryAddHostedService<THostedService>(this IServiceCollection services)
+           where THostedService : class, IHostedService
+       {
+           services.TryAdd(ServiceDescriptor.Singleton<IHostedService, THostedService>());
+
+           return services;
+       }
+
+       public static IServiceCollection TryAddHostedService<THostedService>(this IServiceCollection services, Func<IServiceProvider, THostedService> implementationFactory)
+           where THostedService : class, IHostedService
+       {
+           services.TryAdd(ServiceDescriptor.Singleton<IHostedService>(implementationFactory));
+
+           return services;
+       }
+   }
+}
```

## Usage Examples

```
var serviceBusSubscriptions = serviceBusConnections.Where(_ => true));
foreach (var serviceBusSubscription in serviceBusSubscriptions)
{
  services.AddHostedService(sp => new MyHostedService(serviceBusSubscription));
}
```

## Alternative Designs

Add an optional parameter to AddHostedService that configures the desired behavior?

## Risks

Behavior of the original AddHostedService method changes, which might lead to problems for some people.
